import React from 'react';
import './Headerbar.css';

class Headerbar extends React.Component {
    render() {
    return (
      <div className="App">
        <header className="App-header">
          <div className="App-logo" />
          <span className="App-Title">Chatter</span>
        </header>
      </div>
    );
  }
}
  export default Headerbar;
